import React from "react";

const Movies = (props) => {
  const { moviesList, count } = props;

  return (
    <div>
      <ul className="List">
        <p>{count}</p>
        {moviesList.map((movie) => {
          return (
            <li className="movie" key={movie.id}>
              {movie.title}
            </li>
          );
        })}
      </ul>
    </div>
  );
};

export default Movies;
